(337, 'ObjectId(587da15e3e7f6833c2805ca5)', 'ObjectId(587d9fc33e7f6833c2805c76)', '2017-01-17T04:45:18.171Z', '2017-01-17T04:45:18.171Z', '["text"]', '', 'I AM SO PROUD OF YOU WHEN I TELL  I AM IN INDIAN.\nI AM SO PROUD TO MY NATIONAL SHIELD (ARMY)\n \nIndian Army The safety, honour & welfare of your country comes first, always & every time. The honour, welfare & comfort of the men you command, come next. Your own ease, comfort & safety come last, always & every time. This had been the motto of the armed forces of India and they followed it through life and death. And a recent one during the rescue operations of Uttarakhand floods.\nBy,\nSaddy', '', ''),
