(431, 'ObjectId(587da90c3e7f6833c2805ddb)', 'ObjectId(587da0383e7f6833c2805c81)', '2017-01-17T05:18:04.255Z', '2017-01-17T05:18:04.255Z', '["text"]', '', 'The moment I am typing this, this which I am able to do freely i.e sharing this message which is coming directly from the bottom of my heart is just because you(The protectors,the Real ) are ensuring me and rest of the nation that I am safe. Such is the level of your altruism. No matter how much I write, I will never be able to justice to your sacrifices in this small test. We all have immense  respect for  your patriotism and duty.\nJAI HIND', '', ''),
(432, 'ObjectId(587da9143e7f6833c2805ddd)', 'ObjectId(587da8993e7f6833c2805dd3)', '2017-01-17T05:18:12.210Z', '2017-01-17T05:18:12.210Z', '["text"]', '', 'Salute To Indian Army Indian Navy and Indian AirForce ...................................\nYou r the real hero"s of our country  \nKeep it up nd God Bless u .Jai Hind\nVande Mataram.', '', ''),
(433, 'ObjectId(587da9363e7f6833c2805de1)', 'ObjectId(587da9263e7f6833c2805dde)', '2017-01-17T05:18:46.489Z', '2017-01-17T05:18:46.489Z', '["text"]', '', 'Jai Jawan', '', ''),
(434, 'ObjectId(587da9383e7f6833c2805de2)', 'ObjectId(587da7473e7f6833c2805da2)', '2017-01-17T05:18:48.689Z', '2017-01-17T05:18:48.690Z', '["text"]', '', 'Thanks a ton all my brothers for taking care of us..Without you all there would have been no celebrations of a festivals.and no happiness all around in our nation..I salute you for the choosing the toughest job on this earth and fulfilling it  with such an innocent heart without any regrets and complaints..Hats off to my INDIAN ARMY...LOVE You all..God bless u.', '', ''),
