(1229, 'ObjectId(587f111aa203c643116a8ce7)', 'ObjectId(587f10f0a203c643116a8ce5)', '2017-01-18T06:54:18.879Z', '2017-01-18T06:54:18.879Z', '["text"]', '', 'Jai hind...thank u for protecting us...', '', ''),
(1230, 'ObjectId(587f1129a203c643116a8ce8)', 'ObjectId(587f1015a203c643116a8cdb)', '2017-01-18T06:54:33.078Z', '2017-01-18T06:54:33.078Z', '["text"]', '', 'BHARAT MATA KI RAKSHA KE LIYE APNI JAAN KURBAN KARNE WALE HAR VEER JAWAN KO MERA KOTI - KOTI PRANAAM\n\nBHARAT MATA KI JAI\n\n\nJAI HIND.      JAI BHARAT.    VANDE MATRAM.', '', ''),
(1231, 'ObjectId(587f1131a203c643116a8ce9)', 'ObjectId(587f104fa203c643116a8cdd)', '2017-01-18T06:54:41.003Z', '2017-01-18T06:54:41.003Z', '["text"]', '', 'Thank you all the Brave Soldiers for your unmatched dedication to the service of the nation. I salute your hard work, the long hours, the endless time away from family.  You all are respected and appreciated, our country needs more heroes like each one of you.', '', ''),
(1232, 'ObjectId(587f1169a203c643116a8ced)', 'ObjectId(587f10eda203c643116a8ce4)', '2017-01-18T06:55:37.076Z', '2017-01-18T06:55:37.076Z', '["text"]', '', 'Its time to #KarSalaam to all the Men/Women who Keep us safe and Give it all to Keep the National Flag flying High', '', ''),
(1233, 'ObjectId(587f1170a203c643116a8cee)', 'ObjectId(587f0e29a203c643116a8cbc)', '2017-01-18T06:55:44.219Z', '2017-01-18T06:55:44.219Z', '["text"]', '', 'â€œSaare jahan se accha Hindostan hamara\nhum bulbulain hai is ki, yeh gulsitan hamaraâ€\n\nFirst and foremost, Iâ€™m shouting out a heartfelt â€œTHANK YOUâ€ for all you have done. It is because of your sacrifices that we able to enjoy our freedoms. We are ever grateful to you and moved and touched by the way you perform your duty unflinchingly. Today, every single member of the Indian Armed Forces is prepared to give up his life for the nation. The day each and every citizen of this country shows this same willingness to sacrifice everything for this great nation INDIA, that will be the beginning of its glorious future.\n\nJai Hind !', '', '');
