(2168, 'ObjectId(5880757b5489cb4df4933e4e)', 'ObjectId(588072905489cb4df4933e12)', '2017-01-19T08:14:51.248Z', '2017-01-19T08:14:51.249Z', '["text"]', '', 'à¤®à¥ˆà¤‚ à¤­à¤¾à¤°à¤¤à¤µà¤°à¥à¤· à¤•à¤¾ à¤¹à¤°à¤¦à¤® à¤…à¤®à¤¿à¤Ÿ à¤¸à¤®à¥à¤®à¤¾à¤¨ à¤•à¤°à¤¤à¤¾ à¤¹à¥‚à¤\nà¤¯à¤¹à¤¾à¤ à¤•à¥€ à¤šà¤¾à¤‚à¤¦à¤¨à¥€ à¤®à¤¿à¤Ÿà¥à¤Ÿà¥€ à¤•à¤¾ à¤¹à¥€ à¤—à¥à¤£à¤—à¤¾à¤¨ à¤•à¤°à¤¤à¤¾ à¤¹à¥‚à¤,\nà¤®à¥à¤à¥‡ à¤šà¤¿à¤‚à¤¤à¤¾ à¤¨à¤¹à¥€à¤‚ à¤¹à¥ˆ à¤¸à¥à¤µà¤°à¥à¤— à¤œà¤¾à¤•à¤° à¤®à¥‹à¤•à¥à¤· à¤ªà¤¾à¤¨à¥‡ à¤•à¥€,\nà¤¤à¤¿à¤°à¤‚à¤—à¤¾ à¤¹à¥‹ à¤•à¤«à¤¼à¤¨ à¤®à¥‡à¤°à¤¾, à¤¬à¤¸ à¤¯à¤¹à¥€ à¤…à¤°à¤®à¤¾à¤¨ à¤°à¤–à¤¤à¤¾ à¤¹à¥‚à¤à¥¤\n\nà¤œà¤¯ à¤œà¤µà¤¾à¤¨ à¤œà¤¯ à¤¹à¤¿à¤¨à¥à¤¦ à¤µà¤‚à¤¦à¥‡ à¤®à¤¾à¤¤à¤°à¤®à¥¤à¥¤\n\n Respect krta hu sath he #Maa #Bahen #Beti ki un k liye kch lines bhi sath  me\n\n\n\nBaatein baatein baatein\nCharo oar chale bas baatein baatein,\n\nMilte sab bhoot hai\nGawah phir bhi kuch na kar paate\nAur ye jitne bhi jo daftar se hain\nNews chalate bakar bakar ke\nDegree wale muft ka samachar banaate.\n\nSab kuch hai manoranjan\nKoi jal ke mari koi khud hi jali jo\nJo kal thi pari ab chup hai khadi,\n\nPar khabar badal gayi agli ghadi\nPhir huwe morche, kaam chhod ke\nJaagi dil bad gaye hero\nDal gaye status dal gayi selfie\nDo din mein phir thinking zero.\n\nChote kapre nahi\nChoti teri soch hai\nTu unme se hai beta\nToh tu is duniya pe boj hai.\n\nChal ek deal kare\nTu meri behan main teri behan\nTujhe meri ka dikhna tan\nAur khud behan pe hoti jalan\nPhir kyun nazron se\nUsko nanga karta hai,\n\nAurat ko chhedta\nNiyat ko ganda karta hai\nMilta kya hai jab tujhko jaana hai\nJail mein\nAur behan bani jinda laash\nTere chote se khel mein.\n\nAndar se khush hoon meri sagi behan nahi koi bhi\nMujhko nahi chinta\nKe kya woh chain se soyegi,\n\nMain nahi swarthi\nYe dard mujhko jacha nahi\nHum janwar ya napunsak hai\nKyun ki mard sala bacha nahi.\n\nAurat bojh nahi\nBojh banaya humne hai\nSati se leke baal vivah\nDahej badhaya humne hai,\n\nSamaaj banaya humne hai\nRiwaj banaya humne hai\n Aurat ko Dhabi hui awaz bnaya hmne hai', '', ''),
