(2408, 'ObjectId(5880939a82a8e15b8c1db832)', 'ObjectId(5880935d82a8e15b8c1db82c)', '2017-01-19T10:23:22.731Z', '2017-01-19T10:23:22.731Z', '["text"]', '', 'Being in the Indian Army is a tough job, indeed . Our brave soldiers stay awake and sacrifice all to protect us. They face insurmountable challenges and hurdles but choose to never give up.', '', ''),
