(2917, 'ObjectId(5880ec1011e3b50d1a317737)', 'ObjectId(5880ea0511e3b50d1a317724)', '2017-01-19T16:40:48.801Z', '2017-01-19T16:40:48.801Z', '["text"]', '', 'I fall short of words !\n I shed a tear of joy ! \nMy heart beams with pride ! \nI live a life that is secure .\nI am smiling and crying and laughing out loud and adding moments after moments to my diary of life !\nI m grateful to all but mostly to the heroes of our nation - Our Soldiers! !\n\nThe pride of India !\n\n Thank you for selflessly giving up on every precious moments in life to live the better life of a hero of a hero -serving the nation with your head held high and never complaining about the million hurdles you face everyday to protect us! But you only are giving back in best way possible 24/7 ! \nHopefully we were able to leave a little smile on your face as well !\nI salute you !\nThank you from the core of my heart ! \n\n#KarSalaam \n- Peri :)', '', ''),
