(2969, 'ObjectId(5880f4d811e3b50d1a3177fa)', 'ObjectId(5880f35d11e3b50d1a3177dd)', '2017-01-19T17:18:16.761Z', '2017-01-19T17:18:16.761Z', '["text"]', '', 'Today,I thank all the brave soldiers who are there protecting our borders,fighting for  our nation and ensuring we live in all the comforts...Sending best wishes on Independence Day to u..', '', ''),
