(2975, 'ObjectId(5880f64811e3b50d1a31780c)', 'ObjectId(5880f17c11e3b50d1a3177c3)', '2017-01-19T17:24:24.709Z', '2017-01-19T17:24:24.710Z', '["text"]', '', 'Dear soldiers, \nSalutations to you & the\n entire #IndianDefence\nForces-#THE_INDIAN_ARMY, #THE_INDIAN_AIR_FORCE & #THE_INDIAN_NAVY . Our countless\n tributes to the brave men \nmanning our borders who \nensure that we can have a \npeaceful sleep in our\n homes. Your sacrifices, your valour, your\n contribution towards\n making our nation a safer\n & better place to live in will \nbe evergreen for centuries \n& generations to come. \n#JaiHind.\n#KarSalaam_To_Our_Soldiers.', '', ''),
(2976, 'ObjectId(5880f66111e3b50d1a31780d)', 'ObjectId(5880f43511e3b50d1a3177f1)', '2017-01-19T17:24:49.671Z', '2017-01-19T17:24:49.671Z', '["text"]', '', 'The true soldier fights, Not because he hates, what is front him, but because he loves , what is behind him.A man of courage in peace, is a man of courage in war....... we salutes you ....... Jaihind.......', '', ''),
