(5015, 'ObjectId(58837bc24a0f6210945adad9)', 'ObjectId(588379b54a0f6210945adac1)', '2017-01-21T15:18:26.590Z', '2017-01-21T15:18:26.590Z', '["text"]', '', 'Salaam hai us jawaan ko jo apna tan, man, dhan tyag k Hindustan aur Hindustaniyon ki rakshaa kartaa hai,.\nSalaam hai us jawaan ko jo apni jaan ki baazi lagaa kar raksha karta hai hum sab ki.,\nSalaam hai us jawaan ko jo bina parwah kiye faulad se ladtaa hai.,.\nSalaam hai us jawaan ko jo bina dare angaar k sholonn se ladta hai.,\nSalaam hai us jawaan ko jo bina peeche hate dushmanon se ladta hai.,\n\nYeh sab sirf humare liye., aur har desh wasiyon ki raksha karne liye karta hai is desh ka sainik.,\n\nJai jawaan, \nJai Kisaan.,\n\nA great Salute to Our Country Defense Army for Protecting from all kind of harms.,\nBy sacrificing their livelihoods..\n\nThank you \nThanks a ton Soldiers.,\n\nRegards\nMohammed Ajaz Pasha\n\nA common Indian', '', ''),
