¾à¤°à¤¤à¥€à¤¯ à¤¸à¥‡à¤¨à¤¾\n\nà¤‡à¤¸à¤•à¤¾ à¤¹à¤®à¥‡à¤‚ à¤…à¤«à¤¸à¥‹à¤¸ à¤¹à¥ˆ à¤•à¤¿ à¤…à¤ªà¤¨à¥‡ à¤¦à¥‡à¤¶ à¤•à¥‹ à¤¦à¥‡à¤¨à¥‡ à¤•à¥‡ à¤²à¤¿à¤ à¤¹à¤®à¤¾à¤°à¥‡ à¤ªà¤¾à¤¸ à¤•à¥‡à¤µà¤² à¤à¤• à¤¹à¥€ à¤œà¥€à¤µà¤¨ à¤¹à¥ˆà¥¤"\n\n\nSATH HE SAMAAN KRTA HU  DESH  KI AURAT  KA  TOH  AURATO K LIYE  KUCH  LINES  DEDICATE KRTA HU.....\n\nBaatein baatein baatein Charo oar chale bas baatein baatein, Milte sab bhoot hai Gawah phir bhi kuch na kar paate Aur ye jitne bhi jo daftar se hain News chalate bakar bakar ke Degree wale muft ka samachar banaate. Sab kuch hai manoranjan Koi jal ke mari koi khud hi jali jo Jo kal thi pari ab chup hai khadi, Par khabar badal gayi agli ghadi Phir huwe morche, kaam chhod ke Jaagi dil bad gaye hero Dal gaye status dal gayi selfie Do din mein phir thinking zero. Chote kapre nahi Choti teri soch hai Tu unme se hai beta Toh tu is duniya pe boj hai.\n\nChal ek deal kare Tu meri behan main teri behan Tujhe meri ka dikhna tan Aur khud behan pe hoti jalan Phir kyun nazron se Usko nanga karta hai, Aurat ko chhedta Niyat ko ganda karta hai Milta kya hai jab tujhko jaana hai Jail mein Aur behan bani jinda laash Tere chote se khel mein. Andar se khush hoon meri sagi behan nahi koi bhi Mujhko nahi chinta Ke kya woh chain se soyegi, Main nahi swarthi Ye dard mujhko jacha nahi Hum janwar ya napunsak hai Kyun ki mard sala bacha nahi. Aurat bojh nahi Bojh banaya humne hai Sati se leke baal vivah Dahej badhaya humne hai, Samaaj banaya humne hai Riwaj banaya humne hai In auraton ki dabi huyi awaz banaya humne hai.\n\nRESPECT  ARMY\nRESPECT  WOMEN\nRESPECT OUR NATION\n\n                                                            JAI  HIND', '', ''),
