(5184, 'ObjectId(5884864fb6935f220c779282)', 'ObjectId(5884862fb6935f220c779281)', '2017-01-22T10:15:43.435Z', '2017-01-22T10:15:43.435Z', '["text"]', '', 'Jai hind jai hind ki sena', '', ''),
(5185, 'ObjectId(588486a9b6935f220c779284)', 'ObjectId(58848422b6935f220c77927e)', '2017-01-22T10:17:13.289Z', '2017-01-22T10:17:13.289Z', '["text"]', '', 'Jai Hind! Ae humaare Veer Sipahi.. Aap logo ko salaam. Ganatantra Divas ke shubh avsar par aap ko aur aapke pariwar ke sadasyo ko shubh kaamnaye. Diwali par jab aap apne baccho ke saath nahi rehte, Eid ke din apni amma aur abbu ko gale nahi laga paate aur jab aap log Holi ke din apne moholle waalon ke khushi aur rang mein shaamil nahi ho paate, un palon mein aapko jo mehsoos hota hain wo humlog mehsoos kar sakte hain. Lekin doosri taraf, jo bharosa jo vishwas aur jo suraksha ki ummeed aap logo par hai, wo ummeed hum log apne neta aur mantri ke upar bhi nahin rakhte, sirf aaplog hi woh insaan hain jo insaano ke kadar karte huwe apna kartavya ka paalan karte hain. Pura Hindustan ka vishwas matlab Indian Army, Indian Navy aur Indian Air Force. Allah aap logo ko hamesha kaamyaabi de aur surakshit rakhe taaki humaare dushman, India ki vishwas ki buniyaad ko hilaa naa paye. Jai Hind! Jai Bharat!', '', ''),
(5186, 'ObjectId(588486d7b6935f220c779285)', 'ObjectId(58848697b6935f220c779283)', '2017-01-22T10:17:59.222Z', '2017-01-22T10:17:59.222Z', '["text"]', '', 'Bharatmata ki jai', '', ''),
(5187, 'ObjectId(58848775b6935f220c779289)', 'ObjectId(588486ecb6935f220c779286)', '2017-01-22T10:20:37.038Z', '2017-01-22T10:20:37.039Z', '["text"]', '', 'Hame apne saniko par garv hai. Koi bhi political party please unka kayak na banaye', '', ''),
(5188, 'ObjectId(588487f5b6935f220c77928b)', 'ObjectId(588487d6b6935f220c77928a)', '2017-01-22T10:22:45.711Z', '2017-01-22T10:22:45.711Z', '["text"]', '', 'Brav work', '', ''),
(5189, 'ObjectId(5884884db6935f220c77928c)', 'ObjectId(588485a2b6935f220c779280)', '2017-01-22T10:24:13.768Z', '2017-01-22T10:24:13.768Z', '["image"]', 'image-1485080558962.jpeg', 'KarSalaamSlute to our brave soldiers\n      Soldiers \n                    Real \n                           Hero', '', ''),
(5190, 'ObjectId(58848877b6935f220c77928f)', 'ObjectId(58848851b6935f220c77928d)', '2017-01-22T10:24:55.649Z', '2017-01-22T10:24:55.649Z', '["text"]', '', 'We proud our indian soldiers thnak u', '', ''),
(5191, 'ObjectId(58848889b6935f220c779292)', 'ObjectId(58848852b6935f220c77928e)', '2017-01-22T10:25:13.821Z', '2017-01-22T10:25:13.821Z', '["text"]', '', 'Thanks for saving us', '', ''),
(5192, 'ObjectId(588488dab6935f220c77929f)', 'ObjectId(58848758b6935f220c779288)', '2017-01-22T10:26:34.469Z', '2017-01-22T10:26:34.469Z', '["image"]', 'image-1485080562595.jpeg', 'Jai hind', '', ''),
(5193, 'ObjectId(588489a9b6935f220c7792a1)', 'ObjectId(5884894ab6935f220c7792a0)', '2017-01-22T10:30:01.892Z', '2017-01-22T10:30:01.892Z', '["text"]', '', 'We are proud to be INDIAN...WE ARE SAFE BECAUSE OF YOU PEOPLE..I JUST WANT TO SAY ON BEHALF OF ALL MY COUNTRY PEOPLE !JAI HIND!', '', ''),
(5194, 'ObjectId(58848a0bb6935f220c7792a2)', 'ObjectId(588486f9b6935f220c779287)', '2017-01-22T10:31:39.200Z', '2017-01-22T10:31:39.200Z', '["text"]', '', 'The selfless service you do to protect our country and lay your life to save us from all the internal and external enemies. I feel so miniscule in front of you. And my life insignificant. Jai Hind!', '', ''),
(5195, 'ObjectId(58848b59b6935f220c7792a5)', 'ObjectId(58848abfb6935f220c7792a4)', '2017-01-22T10:37:13.514Z', '2017-01-22T10:37:13.514Z', '["text"]', '', 'We appreciate and salute the spirit of patriotism..\nWatanke rakhwaloon ko anginatan salaam', '', ''),
(5196, 'ObjectId(58848b9fb6935f220c7792ab)', 'ObjectId(58848a1fb6935f220c7792a3)', '2017-01-22T10:38:23.610Z', '2017-01-22T10:38:23.610Z', '["text"]', '', 'Because of your dedication we are living peacefuly\n   hats of to all  JAI HIND', '', ''),
(5197, 'ObjectId(58848cb4b6935f220c7792b0)', 'ObjectId(58848be8b6935f220c7792ae)', '2017-01-22T10:43:00.984Z', '2017-01-22T10:43:00.984Z', '["text"]', '', 'We salute and respect you courage... We proud of ... We safe because of you...  Thanks..', '', ''),
(5198, 'ObjectId(58848e19b6935f220c7792b1)', 'ObjectId(58848c77b6935f220c7792af)', '2017-01-22T10:48:57.608Z', '2017-01-22T10:48:57.608Z', '["text"]', '', '#KarSalaam #saluting our soldiers as India gets ready to celebrate Republic Day', '', ''),
(5199, 'ObjectId(58848f67b6935f220c7792b3)', 'ObjectId(58848f32b6935f220c7792b2)', '2017-01-22T10:54:31.202Z', '2017-01-22T10:54:31.202Z', '["text"]', '', 'My salaam to all bravehearts God bless', '', ''),
(5200, 'ObjectId(5884914cb6935f220c7792b8)', 'ObjectId(588490fab6935f220c7792b5)', '2017-01-22T11:02:36.275Z', '2017-01-22T11:02:36.275Z', '["text"]', '', 'Bharat hamari aan aur shan ha', '', ''),
