(5206, 'ObjectId(588492beb6935f220c7792c1)', 'ObjectId(588490cbb6935f220c7792b4)', '2017-01-22T11:08:46.428Z', '2017-01-22T11:08:46.428Z', '["text"]', '', '#Kar Salaam\n \nWe salute of our Indian Army & I m pround to be an Indian  :\njust wanna say that .\n#Aaj pehar ki raat peharwe savdhan rehna , \n  "shatru hai shaitan peharwe savdhan rehna"', '', ''),
(5207, 'ObjectId(58849324b6935f220c7792c3)', 'ObjectId(588492f4b6935f220c7792c2)', '2017-01-22T11:10:28.850Z', '2017-01-22T11:10:28.850Z', '["text"]', '', 'Pride of our nation. We feel secure under you.', '', ''),
(5208, 'ObjectId(58849447b6935f220c7792c6)', 'ObjectId(58849366b6935f220c7792c4)', '2017-01-22T11:15:19.365Z', '2017-01-22T11:15:19.366Z', '["text"]', '', 'Jahan tum. Or hum mar jate. Hai. Hindu or. Musalman me fark. Samjhkar, wahin kuch. Log mar. Jate. Hi barf. Me dab kar', '', ''),
(5209, 'ObjectId(588494ecb6935f220c7792c8)', 'ObjectId(588494ceb6935f220c7792c7)', '2017-01-22T11:18:04.667Z', '2017-01-22T11:18:04.667Z', '["text"]', '', 'We pround of our soldiers...', '', ''),
(5210, 'ObjectId(588495d9b6935f220c7792cb)', 'ObjectId(588495a2b6935f220c7792ca)', '2017-01-22T11:22:01.020Z', '2017-01-22T11:22:01.020Z', '["text"]', '', 'We feel proud to be under your alertness and provide safety to we all.', '', '');
