(5309, 'ObjectId(5884e7cfb6935f220c7793de)', 'ObjectId(5884e683b6935f220c7793d9)', '2017-01-22T17:11:43.610Z', '2017-01-22T17:11:43.610Z', '["text"]', '', 'Jai hind soldiers,\n\nLive for India\n\nLove for India\n\nServe for India\n\nWin for India\n\nMove on for India\n\nGo for India\n\nWars are won by killing all enemies not lossing lives\n\nSACHIN SACHDEVA', '', ''),
(5310, 'ObjectId(5884e93fb6935f220c7793df)', 'ObjectId(5884e6ebb6935f220c7793db)', '2017-01-22T17:17:51.702Z', '2017-01-22T17:17:51.702Z', '["text"]', '', 'Apni Azaadi ko hargis bhula sakte nahi\nSar kata sakte hai lekin sar jhuka sakte nahi!\n\nAaj abhi mai kapil sharma show dekh kar has raha hu or sehat bana raha hu kyo ki aap log seema per khade hai, Dushmano ka khaatma kar rahe hai, Aap sabhi jawano ko mai dil se naman karta hu. BHARAT MATA KI JAI,  JAI JAWAAN JAI HIND.', '', ''),
