(5608, 'ObjectId(588634c82daa6448e8e1997c)', 'ObjectId(588634622daa6448e8e1997a)', '2017-01-23T16:52:24.089Z', '2017-01-23T16:52:24.089Z', '["text"]', '', 'I salute the soldiers who are the guardians of our country I wish them a happy republic day', '', ''),
(5609, 'ObjectId(5886362b45018249259cf291)', 'ObjectId(5886360445018249259cf290)', '2017-01-23T16:58:19.314Z', '2017-01-23T16:58:19.314Z', '["text"]', '', 'Heart of a patriot beats for its nation. This Republic Day salute the epitome of courage & send them wishes at www.karsalaam.in #KarSalaam @Shraddh9793  @924karan', '', ''),
(5610, 'ObjectId(5886383b45018249259cf295)', 'ObjectId(5886382345018249259cf294)', '2017-01-23T17:07:07.005Z', '2017-01-23T17:07:07.005Z', '["text"]', '', 'Best luck and God speed !!', '', ''),
(5611, 'ObjectId(58863bb7ab2f1249540a33d4)', 'ObjectId(58863a7fab2f1249540a33d3)', '2017-01-23T17:21:59.401Z', '2017-01-23T17:21:59.401Z', '["text"]', '', 'u guard the borders to help us sleep pecefully at night .. help us celebrate all festivals and occassions without u celebrating with ur families.. this space will be short of words if we have to thank u.. salute to all real heroes and their families for their sacrifice for us.. Jai Hind', '', ''),
(5612, 'ObjectId(58863f9f2fd3c949a45f8ce7)', 'ObjectId(58863f0c2fd3c949a45f8ce6)', '2017-01-23T17:38:39.061Z', '2017-01-23T17:38:39.061Z', '["text"]', '', 'I love Indian soldiers!...', '', ''),
(5613, 'ObjectId(588646cc2fd3c949a45f8ce8)', 'ObjectId(587dfbb23e7f6833c2806350)', '2017-01-23T18:09:16.198Z', '2017-01-23T18:09:16.198Z', '["video"]', '', 'Wishing all our soldiers Happy Republic Day in Advance! Huge salute to our brave heart soldiers  #KarSalaam\nhttps://t.co/0r4qCVKdET', 'video-1485194696168.mp4', 'video-1485194696168.png'),
(5614, 'ObjectId(58864a102fd3c949a45f8cef)', 'ObjectId(588649562fd3c949a45f8ce9)', '2017-01-23T18:23:12.695Z', '2017-01-23T18:23:12.695Z', '["image"]', 'image-1485195700578.jpeg', 'Our Indian army soldiers sacrifice their whole life, their family, their youth and even festivals on which whole India gets a holiday but our Indian army Jawan still donâ€™t have a holiday #Karsalaam todayâ€™s post is all dedicated to our brave soldiers of our country India who are constantly protecting all of us without taking break', '', ''),
(5615, 'ObjectId(58864f6e2fd3c949a45f8cf5)', 'ObjectId(58864eb32fd3c949a45f8cf4)', '2017-01-23T18:46:06.217Z', '2017-01-23T18:46:06.217Z', '["text"]', '', 'Wishing our soldiers and their families a Very Happy Republic Day! Thanks for giving us and our loved ones peaceful nights to sleep...', '', ''),
(5616, 'ObjectId(5886748b2fd3c949a45f8cfc)', 'ObjectId(587f4b83fd591c4b40bcd1f4)', '2017-01-23T21:24:27.585Z', '2017-01-23T21:24:27.585Z', '["text"]', '', 'Desh ke liys jinhone apne pran gavaye, desh ke liye jinkone appna jeevan kiya nauchavar, aise veer purushon ko hum sabhi ka sadar naman. Wishing soldiers a Happy Republic Day.\nOn the occasion of Republic Day, we thank the brave soldiers who have fought for the pride and honor of our country and made us proud. Wishing Happy Republic day to our soldiers.\nProud to be an indain.', '', ''),
(5617, 'ObjectId(5886ad102fd3c949a45f8d00)', 'ObjectId(5886ac8c2fd3c949a45f8cff)', '2017-01-24T01:25:36.901Z', '2017-01-24T01:25:36.901Z', '["text"]', '', 'Thank you\nFor your bravery hard work and dedication to our country. \nWe salute', '', ''),
(5618, 'ObjectId(5886b3db2fd3c949a45f8d02)', 'ObjectId(5886b3852fd3c949a45f8d01)', '2017-01-24T01:54:35.391Z', '2017-01-24T01:54:35.391Z', '["text"]', '', 'Wish you a Happy Republic day', '', ''),
(5619, 'ObjectId(5886b767b6521c519a526771)', 'ObjectId(5886b6eb3f08015187f44402)', '2017-01-24T02:09:43.571Z', '2017-01-24T02:09:43.571Z', '["text"]', '', 'From the bottom of our hearts, we wish you all a very happy Republic day.....\nWe will be admiring you for your excellent service to our nation...\nAll The Best', '', ''),
(5620, 'ObjectId(5886ba480d29fe5240b2fc6e)', 'ObjectId(5886ba2a0d29fe5240b2fc6d)', '2017-01-24T02:22:00.308Z', '2017-01-24T02:22:00.308Z', '["text"]', '', 'Please take care of Urs,\nLike you take care for us.\nA big salute to you all. \n"Jai Hind"', '', ''),
(5621, 'ObjectId(5886bad7e386b45263f23aca)', 'ObjectId(5886ba7d5a8f2b5253f3e2cb)', '2017-01-24T02:24:23.259Z', '2017-01-24T02:24:23.259Z', '["text"]', '', 'Brave Indian soldiers we are really proud of you people. Keep the Indian flag always high in this world, We salute to from our heart for your dedication and sacrifice towards the nation.', '', ''),
(5622, 'ObjectId(5886c225dc7249540b9f4e92)', 'ObjectId(5886c0ca77f06253c11f10d9)', '2017-01-24T02:55:33.559Z', '2017-01-24T02:55:33.559Z', '["text"]', '', 'To our Brave Soldiers,\nI want to say Thankyou from my deepest Heart, for your all effort & sacrifice what you are continuously doing for our Nation and for our life.\nI wish i could also join you in your pain, so that i can actually feel the emotion of Nationalism as nobody feel it better than you.\n\nThankyou again & Thankyou alyways.\nVinod Rana', '', ''),
(5623, 'ObjectId(5886c43a0417d8548ae6c274)', 'ObjectId(5886c1dc3a193f53f82911ee)', '2017-01-24T03:04:26.879Z', '2017-01-24T03:04:26.879Z', '["text"]', '', 'I have learnt from you\n- How to set a goal\n- How to set milestones & how to make alternate plan\n- How to act upon it\n- How to overcome obstacles\n- How to develop a "Never Never Give Up" kind of attitude\n- How to follow direction\n- How to contineously follow standard & discipline\n- How to cooperate or support others\n- How to achieve & celebrate success\nYou are truely my HERO. \nToday I am safe because of your sacrifice.\nI love you, I am proud of you.\nThe entire nation loves you & proud of you.', '', ''),
(5624, 'ObjectId(5886c4700dca1b549ffb478f)', 'ObjectId(5886c45d0dca1b549ffb478e)', '2017-01-24T03:05:20.236Z', '2017-01-24T03:05:20.236Z', '["text"]', '', 'Jai Hind', '', ''),
(5625, 'ObjectId(5886c4fbb23e1f54b4550c84)', 'ObjectId(5886c4dcb23e1f54b4550c83)', '2017-01-24T03:07:39.021Z', '2017-01-24T03:07:39.021Z', '["text"]', '', 'Respect nd love.', '', ''),
(5626, 'ObjectId(5886c6b9c9e7e8552ccf38c4)', 'ObjectId(5886c67e7db15f55194c9998)', '2017-01-24T03:15:05.064Z', '2017-01-24T03:15:05.064Z', '["text"]', '', 'VERY VERY GOOD MORNING . WE SALUTE TO REAL HEROES', '', ''),
(5627, 'ObjectId(5886c6ed27b7e8553c9e9e8b)', 'ObjectId(5886c6a1c9e7e8552ccf38c3)', '2017-01-24T03:15:57.397Z', '2017-01-24T03:15:57.397Z', '["text"]', '', 'Salute you all for being there. Not everyone get chance to serve the country as you do.\n\nS - Self Confidence\nO - Ocean of Sacrifices\nL - Loves their Country\nD - Dies for their nation\nI - Integration\nE - Encourage to others\nR - Respect the orders of Seniors', '', ''),
(5628, 'ObjectId(5886c7a666adde55554cdccd)', 'ObjectId(5886c76666adde55554cdccc)', '2017-01-24T03:19:02.730Z', '2017-01-24T03:19:02.730Z', '["text"]', '', 'Jai hind', '', ''),
(5629, 'ObjectId(5886c7d765dd005568404f58)', 'ObjectId(5886c72927b7e8553c9e9e8c)', '2017-01-24T03:19:51.734Z', '2017-01-24T03:19:51.734Z', '["text"]', '', 'Jai Hind. I Salute & appreciate hard work of each & every soldier of Indian Army. \nThanks. Bharat Mata Ki Jay.', '', ''),
(5630, 'ObjectId(5886c9b2f0724555dba992c6)', 'ObjectId(5886c9a7f0724555dba992c5)', '2017-01-24T03:27:46.956Z', '2017-01-24T03:27:46.956Z', '["text"]', '', 'Jai Hind. I Salute & appreciate hard work of each & every soldier of Indian Army. Thanks. Bharat Mata Ki Jay.', '', ''),
