(5645, 'ObjectId(5886dfeac4bbfb5a6217159f)', 'ObjectId(5886df88aa804b5a4d76fc10)', '2017-01-24T05:02:34.032Z', '2017-01-24T05:02:34.032Z', '["image"]', 'image-1485234142535.jpeg', 'Jai hind.', '', ''),
(5646, 'ObjectId(5886e121d1f4f95aadb966d0)', 'ObjectId(5886df6134cefd5a38b8091f)', '2017-01-24T05:07:45.879Z', '2017-01-24T05:07:45.879Z', '["text"]', '', 'Karsalaam for your courage to leave your families and protect ours,\nKarsalaam for the bravery with which you fight for us without caring for your life\nKarsalaam for the love that you have to risk your life without even knowing us personally\nKarsalaam, karsalaam, karsalaam :)', '', ''),
(5647, 'ObjectId(5886e18cd1f4f95aadb966d2)', 'ObjectId(5886e16dd1f4f95aadb966d1)', '2017-01-24T05:09:32.840Z', '2017-01-24T05:09:32.840Z', '["text"]', '', 'The whole country is their family, the honor of each countrymen their own. Guarding the borders or helping during calamity they are the men to be adored. An Army man will never let you down will pull you from the ashes encouraging you to face the life once again.â€ REAL HEROES WHO INSPIREâ€.', '', ''),
(5648, 'ObjectId(5886e2276575bc5ad74f0cc6)', 'ObjectId(5886de7bfb8dd65a13329ffd)', '2017-01-24T05:12:07.174Z', '2017-01-24T05:12:07.174Z', '["text"]', '', 'I would like to thank all the soldiers for the valuable contribution they provide to me by taking care of our borders . It is because of you that I am able to lead a free and safe life .  Salute to you and your passion . Wish you good luck , prosperity and success ALWAYS !', '', ''),
