(5655, 'ObjectId(5886ef219f9dee5e046b64c8)', 'ObjectId(5886ee38fc789c5db09a02eb)', '2017-01-24T06:07:29.630Z', '2017-01-24T06:07:29.630Z', '["text"]', '', 'I wish each and every soldier & freedom fighter who fought so hard and are still fighting at the border so that we can sleep in peace at our homes. I thank all the brave soldiers who gave their lives so that we Indians can see freedom. So keeping their sacrifices in mind I wish all of you a Very happy Republic Day.\nJai Hind', '', ''),
(5656, 'ObjectId(5886ef229f9dee5e046b64c9)', 'ObjectId(5886eca79867945d09df2416)', '2017-01-24T06:07:30.508Z', '2017-01-24T06:07:30.508Z', '["text"]', '', 'à¤†à¤ª à¤¹à¥ˆ à¤¤à¥‹ à¤¹à¤® à¤¹à¥ˆ, à¤†à¤ª à¤¹à¥ˆ à¤¤à¥‹ à¤­à¤¾à¤°à¤¤ à¤¹à¥ˆ !! We are safe here because of you peoples are saving our life from enemies of our country. In each seasons you are standing for only one reasons to save our life without any your personal benefits of yours. Please be there always forever for happiness and smiles on our children. JAI HIND !! BHARAT MATA KI JAY!! JAY JAVAN JAY KISHAN !! SALUTE FROM ANKIT D SHAH.', '', ''),
